# Start with the simplest: just first 128

r=0.0
r2=0.0

inmem = (0..127).to_a

# Allow loading max 1 expert / iteration

use_experts = 6
loadexpert = true
lru = true
porder = false # good
porder2 = false # bad

ps=[5.5]*256
ps2=[5.0]*256

for j in 0...top8.size
    top = top8[j]
    pp = top8probs[j]
    for i in 0...use_experts
        ps[top[i]]+=pp[i]
        ps[top[i]]=ps[top[i]]*0.95
    end
    #for i in 0...ps.size
    #    ps[i]=ps[i]*0.95
    #end
    pp2 = top8src_data[j]
    for i in 0...256
        ps2[i]+=pp2[i]
        ps2[i]=ps2[i]*0.9
    end
  if porder
    inmem.sort_by! { |i| -ps[i] }
  end
  if porder2
    inmem.sort_by! { |i| -ps2[i] }
  end
  # Load 1 expert (0.5 -> 0.62)
  if loadexpert
    for i in 0...use_experts
      unless inmem.include?(top[i])
          inmem[127]=top[i]
        break
      end
    end
  end
  # Now LRU algorithm: if include, push to front:
  if lru
    for i in 0...use_experts
      if inmem.include?(top[i])
      inmem.delete(top[i])
      inmem.unshift(top[i])
      end
    end
  end
  for i in 0...use_experts
    r+=1 if inmem.include?(top[i])
  end
  # Alternative scoring: top_use_experts_in_mem
  inmem_probs = inmem.map { |i| pp2[i] }
  inmem_probs.sort!
  for i in 0...use_experts
    r2 += inmem_probs[inmem_probs.size - 1 - i]
  end
